//a sentenca 'const potencia = a ** b' é uma maneira mais nova de fazer potencia. Nesta linha abaixo ele esta escrita de varias formas para serem suportadas por outras versoes do js
"use strict";var Calculadora={_resultado:0,get resultado(){return this._resultado},somar:function(t,r){var o=t+(1<arguments.length&&void 0!==r?r:0);return this._resultado+=o,this},potencia:function(t,r){var o=Math.pow(t,r);return this._resultado+=o,this},zerar:function(){return this._resultado=0,this},log:function(){console.log(this._resultado)}};
//em cima é a calculadora e embaixo é a chamada da calculadora
"use strict";console.log(Calculadora.somar(5).potencia(2,8).resultado),Calculadora.zerar().somar(2,3).somar(3).log();

